import { Outlet } from "react-router-dom";
import React from "react";
import useAuth from "./hooks/useAuth";

const Layout = () => {
  const { auth } = useAuth();
  console.log("LAYOUT AUTH: ", auth);
  console.log("LAYOUT AUTH CHECK: ", auth == {});
  return (
    <main className="App">
      {Object.keys(auth).length === 0 ? (
        <h1>NIEZALOGOWANY</h1>
      ) : (
        <h1>ZALOGOWANY</h1>
      )}

      <Outlet />
    </main>
  );
};

export default Layout;
